        aria-expanded="false"
      >
        Contact
      </button>
      <ul className="dropdown-menu bungkus">
        <li className="isi">
          <img className="ukurangambar" src={InstagramUsual} alt=""></img>
          <a className="dropdown-item" href="#">
            Instagram
          </a>
        </li>
        <li className="isi">
          <img className="ukurangambar" src={InstagramUsual} alt=""></img>
          <a className="dropdown-item" href="#">
            Another action
          </a>
        </li>
        <li>
          <a className="dropdown-item" href="#">
            Something else here
          </a>
        </li>
      </ul>
    </div>
  );
}

export default MediaSocial;
